await robot.userRequest('参观公司');
await robot.goto('作品展示区');
await robot.speak('欢迎参观我们公司的作品展示区。这里展示了我们双臂机器人的特点和能力。请跟着我继续参观。');

const visitChoice = await robot.ask('您是否需要参观创作室？');

if(visitChoice == '需要'){
    await robot.goto('创作室');
    await robot.speak('这是我们公司的创作室，这里是虚实结合机器人测试平台，具备丰富的特点和功能。请跟着我继续参观。');
    await robot.goto('作品展示区');
}

await robot.speak('参观结束，请跟着我前往充电桩。');
await robot.goto('充电桩');
await robot.speak('参观结束，感谢您的参观。');

